	}
	const obj2 = {
		'id': 2,
		'name': 'James',
		'location': 'Colombia',
	}
	const obj3 = {
		'id': 5,
		'name': 'Serena',
		'location': 'San Francisco',
	}
	const result = [...obj1, ...obj2, obj3];

	return result;
}

